import React from 'react';
import "./style.scss";
import profilePhoto from "../images/logo/man.jpg";
import { SocialLogos } from "../misc";
const Home = () => {

    return (
        <div className="home">
            <div className="home-colorSepator"></div>
            <div className="home-profilePhoto_container">
                <div className="image">
                    <img src={profilePhoto} alt="jerry" title="Jerry Prophete" />
                </div>
            </div>

            <div className="home-socialMedia">
                <SocialLogos isTrue = {true}/>
            </div>
            <div className="home_para">
                <p>Hey There!</p>
            </div>
        </div>
    );
};

export default Home;
